import React from 'react';

const ApprovalModule: React.FC = () => {
  return (
    <div className="space-y-6">
      <div className="bg-white shadow rounded-lg p-6">
        <h1 className="text-2xl font-bold text-gray-900 mb-4">Quantity Approval</h1>
        <p className="text-gray-600 mb-6">
          Approve or hold fabric quantities based on quality and business requirements.
        </p>

        {/* Placeholder for ApprovalList component */}
        <div className="border-2 border-dashed border-gray-300 rounded-lg p-8 text-center">
          <p className="text-gray-500">Quantity Approval Management will be implemented here</p>
          <p className="text-sm text-gray-400 mt-2">
            Features: List of ready entries, approval/hold actions, hold reason modals
          </p>
        </div>
      </div>
    </div>
  );
};

export default ApprovalModule;
